      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col1 + + 27 NOT BETWEEN 74 AND ( + 81 * 66 ) OR NOT ( NULL ) IS NULL;
  - name: tab1

outputs:
